import React from "react";
import { set, get } from "idb-keyval";

//    "idb-keyval": "^3.1.0",

class IndexDB extends React.Component {
  // first load it wont have data from API
  state = {
    DBloading: true
  };
  componentDidMount() {
    this.setState({
      dbLoading: false
    });
    set("foo", "bar");
    get("foo").then(data => console.log(data));
  }
  render() {
    return (
      <div>
        <h1>IDXDB</h1>
      </div>
    );
  }
}

export default IndexDB;
